export const sortData = (data) =>
{
    const sortedData = [...data];  // data api se jo ara hai..vo sortedData array mre copy hogya
    
    sortedData.sort((a,b) =>
    {
        if(a.cases>b.cases)
        {
            return -1;
        }
        else{
            return 1;
        }
    })
    return sortedData;
}
